import react from "react";
import reactDom from "react-dom";

reactDom.render(
  [
  <h1>NETFLIX</h1>,
  <p>List of my top 5 favoirite Netflix series</p>,
  <ol>
      <li>Dark</li>
      <li>Money Hiest</li>
      <li>Sacred Games</li>
      <li>Stranger Things</li>
      <li>Lusifer</li>
  </ol>
  ]
  , document.getElementById("root")
);
